import Link from 'next/link'

const Header = () => {
    return (
        <nav class="navbar level is-fixed-top is-light">
            <div class="navbar-brand level-item has-text-centered">
                <Link href="/">
                    <a>Pokedex</a>
                </Link>
            </div>
        </nav>
    )
}

export default Header
